import React from "react";
const AppName =()=>{
    return(
        <section className="movie-container">
   
   <Movie />
   <Movie />
   <Movie />
   <Movie />
  

    </section>
);
};
const Movie =()=> {

    return(
    <article className="eachmovie">
    <img src="https://tse1.mm.bing.net/th?id=OIP.l6KAUPt_KGEG54fWzRmd1gHaEk&pid=Api" alt="nature image"/>
    <h1>above showing is a nature diagram </h1>
    </article>
    );

};

  
    
export default AppName;
